CREATE TABLE `esh_izlemler` (
  `id` int(20) NOT NULL auto_increment,
  `hastatckimlik` varchar(11) collate utf8_turkish_ci NOT NULL,
  `izlemtarihi` varchar(20) collate utf8_turkish_ci NOT NULL,
  `yapilan` varchar(150) collate utf8_turkish_ci NOT NULL,
  `yapildimi` tinyint(1) NOT NULL,
  `neden` tinyint(1) NOT NULL,
  `planli` int(1) NOT NULL,
  `planlanantarih` varchar(12) collate utf8_turkish_ci NOT NULL,
  `yapilacak` varchar(150) collate utf8_turkish_ci NOT NULL,
  `izlemiyapan` varchar(100) collate utf8_turkish_ci NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_turkish_ci;


